import React, { useState } from 'react';
import { useEffect } from 'react';


const Pokemonapi = props => {
    const [responseDatas, setResponseData] = useState([]);

    useEffect(() => {
        fetch(`https://pokeapi.co/api/v2/pokemon`)
            .then(response => response.json())
            .then(response => setResponseData(response.results))
    }, []);


    return (


        <div>
            <div>
                <button type="submit" onClick={Pokemonapi}>Fetch Pokemon</button>
            </div>
            {
                responseDatas.map((pokemons, id) => {
                    return (
                        <div>
                            <span>{pokemons.name}</span>
                        </div>
                    )
                })}
            {/* response.data.results */}
        </div>



    )
}

export default Pokemonapi;
